import {View, Text} from 'react-native';

class NewLesson extends React.Component {
  render () {
    return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>NewLesson</Text>
   </View>
 );

  }
}

export default NewLesson;
